	for(var i = 0; i < this._fields.length; i++) {
	    buffer.push(" ");
	    buffer.push(plt.Kernel.toWrittenString(this._fields[i]));
	}
	buffer.push(")");
	return plt.types.String.makeInstance(buffer.join(""));
